January's episodes of Negativland's receptacle radio show Over the Edge all drawn from &lt;a href=&quot; http://www.negativland.com/ote/&quot; rel=&quot;nofollow&quot; target=&quot;_NEW&quot;&gt; http://www.negativland.com/ote/&lt;/a&gt;
These are the same files that are temporarily hosted at Negativland's website with a few modifications to the ID3 tags. The album names have been changed from &quot;Live from KPFA [date]&quot; to &quot;Over the Edge 2013,&quot; the broadcast date has been moved to the comments, track numbers have been changed from &quot;1&quot; to the episode number for this year, and album art has been added of the Over the Edge logo at &lt;a href=&quot; http://www.negativland.com/&quot; rel=&quot;nofollow&quot; target=&quot;_NEW&quot;&gt; http://www.negativland.com/&lt;/a&gt;
Each episode is 3 hours long except &quot;The Universe Part 2&quot; which is 5.
Descriptions of each episode can be found on their respective show page at &lt;a href=&quot; http://www.negativland.com/ote/?m=2013&quot; rel=&quot;nofollow&quot; target=&quot;_NEW&quot;&gt; http://www.negativland.com/ote/?m=2013&lt;/a&gt;
This torrent contains:
Your Music is the Devil Part 3*
The Chopping Channel (Variation on the End of Music)
The Universe Parts 1 &amp; 2
Find more Negativland and donate at &lt;a href=&quot; http://www.negativland.com/&quot; rel=&quot;nofollow&quot; target=&quot;_NEW&quot;&gt; http://www.negativland.com/&lt;/a&gt;
Listen live every 2nd through 5th Thursday from Midnight-3AM PT at &lt;a href=&quot; http://www.kpfa.org/&quot; rel=&quot;nofollow&quot; target=&quot;_NEW&quot;&gt; http://www.kpfa.org/&lt;/a&gt;
Support the station that broadcasts this madness by donating there as well.
And remember, don't say &quot;Hello.&quot; 
&quot;Copyright infringement is your best entertainment value.&quot;-Negativland

*patched and unpatched versions. The file hosted at &lt;a href=&quot; http://www.negativland.com/ote/&quot; rel=&quot;nofollow&quot; target=&quot;_NEW&quot;&gt; http://www.negativland.com/ote/&lt;/a&gt; had a flaw that excised a good portion of the middle of the show. The patched version uses the lower-bitrate archive hosted at &lt;a href=&quot; http://www.kpfa.org/&quot; rel=&quot;nofollow&quot; target=&quot;_NEW&quot;&gt; http://www.kpfa.org/&lt;/a&gt; to fill in the gap.
